// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8;

import "./ERC20.sol";

/// @title CrowdFudndingDao
/// @author 
/// @notice You can use this contract for mint a new ERC20 based INRtoken
/// @dev All function calls are currently implemented without side effects

contract CrowdFunding{
    //State Variables
    address public admin;
    ERC20Token private token;

    /**
    * @dev Constructor function to set the admin
    * @param _admin admin of this contract
    */

    constructor (address _admin) {
        admin = _admin;
    }

    modifier onlyAdmin() {
        require(admin == msg.sender,"Only admin");
        _;
    }

    modifier isApprovedOrRejectedAlready(uint256 campaignId) {
        require(campaigns[campaignId].status != campainStatus.APPROVED,"Already approved");
        require(campaigns[campaignId].status != campainStatus.REJECTED,"Already rejected");
        _;
    }

    modifier isCampaignFound(uint256 campaignId) {
        require(campaignCount >= campaignId && campaignId > 0,"No campaign");
        _;
    }

    modifier isDeadLinePassed(uint256 campaignId) {
        require(campaigns[campaignId].endDate >= block.timestamp,"DeadLine passed");
        _;
    }

    uint256 public campaignCount;

    struct Campaign{
        // contract address
        address contractAddress;
        // Company Name
        string companyName;
        // Name of the token
        string tokenName;
        // Symbol of the token
        string tokenSymbol;
        // Id of the Campaign
        uint campaignId;
        // Creator of the campaign
        address creator;
        // Title of the campaign
        string campaignTitle;
        // Campaign Description
        string campaignDescription;
        // pricePer token fixed by the user
        uint256 pricePerToken;
        // required fund
        uint256 target;
        // total contribution received
        uint256 contribution;
        // totalHeld Balance
        uint256 heldBalance;
        // Campaign Start Date
        uint256 startDate;
        // Campaign End Date
        uint256 endDate;
        // Status of the campaign
        campainStatus status;
        // Withdraw status
        bool withdrawalStatus;
    }

    struct Company {
        // Name of the company
        string companyName;
        // Token symbol created by the company
        string tokenSymbol;
        // Token name created by the company
        string tokenName;
        // Contract address against the company's campaign
        address contractAddress;
        // Total supply
        uint256 totalSupply;
    }

    struct ContributionReceipt{
        // address of the contributer
        address contributer;
        // Id of the camapign 
        uint256 campaignId;
        // Token of contribution
        uint256 tokens;
        // Eth value
        uint256 receivedEth;
    }

    /**
     * @notice event for campaign creation
     * @dev This event is emitted when a crowdfunding campaign is made.
     * @param campaignId id of the campaign
     * @param _companyName name of the company going to create the campaign
     * @param _title title of the camapaign
     * @param _description detailed description of the campaign
     * @param _pricePerToken price per token for eg : 10 NEO tokens == 100INR( here 1 neo is equal to 10 INR)
     * @param _tokenName Name of the token launched by the user
     * @param deadLine End date for the campaign to contribute,
     * @param _target goal of the crowd funding
     * @param _tokenSymbol symbol of the token launched by the user
     * @param _totalSupply total supply
     */


    event campaignCreated(
        uint256 indexed campaignId,
        string _companyName,
        string _title,
        string _description,
        uint256 indexed _pricePerToken,
        string _tokenName,
        uint256 indexed deadLine,
        uint256 _target,
        string _tokenSymbol,
        uint256 _totalSupply
    );

    /**
     * @notice approval of the campaign
     * @dev this event is emitted when a campaign gets approve by the admin
     * @param campaignId id of the campaign
     */

    event approved(uint256 indexed campaignId);

    /**
     * @notice rejection of the campaign
     * @dev this event is emitted when a campaign gets reject by the admin
     * @param campaignId id of the campaign
     */

    event rejected(uint256 indexed campaignId);

    /**
     * @notice event for contribution
     * @dev this event will emit when the contribution was maded by the users
     * @param campaignId Id of the campaign  
     * @param contribution amount of the contribution by the user
     * @param contributer address of the contributer
     */

    event contribution(uint256 indexed campaignId, uint256 indexed contribution, address indexed contributer);

    /**
     * @notice refund request against the contribution 
     * @dev This event will emit when refund is made
     * @param campaignId Id of the campaign  
     * @param contribution amount of the contribution by the user
     * @param contributer address of the contributer
     */

    event refunded(uint256 indexed campaignId, uint256 indexed contribution, address indexed contributer);

    enum campainStatus {APPROVED,REJECTED,PENDING}

    // CAMPAIGNID => CAMPAINGS
    mapping (uint256 => Campaign) campaigns;

    //CONTRACT ADDRESS => COMPANY
    mapping(address => Company) companies;

    // CAMPAIGNID => CONTRIBUTER => RECEIPT
    mapping (uint256 => mapping(address => ContributionReceipt)) public receipts;

    // USER => BALANCE 
    mapping (address => uint256) balance;

    /**
    * @notice To create the new campaign
    * @dev It will create a new ERC20 token
    * @param _companyName name of the comapany
    * @param _title Title of the campaign
    * @param _description Description of the campaign
    * @param _pricePerToken Campaign creator can decide price per token would be fixed cost
    * @param _tokenName Name of the ERC20 Token
    * @param _tokenSymbol Symbol of the ERC20 token
    * @param deadLine End date for the campaign
    * @param _target Goal of this campaign 
    * @param _totalSupply no of token wants to launch by campaign creator
    **/

    function createCampaign(
        string memory _companyName,
        string memory _title,
        string memory _description,
        uint256 _pricePerToken,
        string memory _tokenName,
        uint256 deadLine,
        uint256 _target,
        string memory _tokenSymbol,
        uint256 _totalSupply
    ) external {
        require(msg.sender != admin, "Admin can't");
        require(_target <= _totalSupply, "invalid target");
        require(block.timestamp < deadLine, "Not allowed for older dates");
        address newContract = address(new ERC20Token(_tokenName, _tokenSymbol, _totalSupply, msg.sender));
        token = ERC20Token(newContract);
        campaignCount++;

        campaigns[campaignCount] = Campaign({
        contractAddress : newContract,
        companyName: _companyName,
        tokenName: _tokenName,
        tokenSymbol : _tokenSymbol,
        campaignId: campaignCount, 
        creator: msg.sender,
        campaignTitle: _title,
        campaignDescription: _description,
        pricePerToken: _pricePerToken,
        target: _target,
        heldBalance: _totalSupply,
        startDate: block.timestamp,
        endDate: deadLine,
        contribution: 0,
        status: campainStatus.PENDING,
        withdrawalStatus: false
        });
        balance[msg.sender] = _totalSupply;

        companies[newContract] = Company({
            companyName: _companyName,
            tokenSymbol : _tokenSymbol,
            contractAddress : newContract,
            tokenName: _tokenName,
            totalSupply : _totalSupply 
        });


        emit campaignCreated(
            campaignCount, 
            _companyName,
            _title,
            _description,
            _pricePerToken,
            _tokenName,
            deadLine,
            _target,
            _tokenSymbol,
            _totalSupply
            );
    }

    /**
    * @notice Approve  campaign
    * @dev admin can approve this campaign
    * @param campaignId campaign is approved by the admin 
    * @return status returning the enum for the referrence of campaign states
    */

    function approveCampaign(uint campaignId) external onlyAdmin isCampaignFound(campaignId)isDeadLinePassed(campaignId) isApprovedOrRejectedAlready(campaignId) returns(campainStatus) {
        campaigns[campaignId].status = campainStatus.APPROVED;
        emit approved(campaignId);
        return campaigns[campaignId].status; 
    }

    /**
    * @notice Reject campaign
    * @dev admin can reject this campaign
    * @param campaignId campaign is rejected by the admin by the help of this id 
    * @return status returning the enum for the referrence of campaign states
    */

    function rejectCampaign(uint campaignId) external onlyAdmin isCampaignFound(campaignId)isDeadLinePassed(campaignId) isApprovedOrRejectedAlready(campaignId) returns(campainStatus) {
        campaigns[campaignId].status = campainStatus.REJECTED;
        emit rejected(campaignId);
        return campaigns[campaignId].status; 

    }

    /**
    * @notice contribute to the campaign
    * @dev getting ERC20 token by giving the fiat currency in msg.value
    * @param campaignId helping to find and contribute against the campaign by this id 
    * @param tokens How many token user want's to buy against the fiat currency
    * @return bool return true if the contribution get success
    */

    function contribute(uint256 campaignId, uint256 tokens) external payable isCampaignFound(campaignId) isDeadLinePassed(campaignId) returns(bool) {
        Campaign storage currentCampaign = campaigns[campaignId];
        ContributionReceipt storage user = receipts[campaignId][msg.sender];
        require(msg.value == currentCampaign.pricePerToken * tokens, "Incorrect amount");
        require(currentCampaign.status == campainStatus.APPROVED, "Not approved");
        if(currentCampaign.contribution == 0){
        require(
            tokens > 0 &&
            currentCampaign.contribution + tokens <= currentCampaign.target &&
            tokens <= currentCampaign.target,
            "Invalids contribution."
        );
        }
        else
        {
            require(tokens > 0 &&
            currentCampaign.contribution + tokens <= currentCampaign.target,
            "Invalid contributions.");
        }

        currentCampaign.contribution += tokens;

        ERC20Token(currentCampaign.contractAddress).transfer(currentCampaign.creator,msg.sender,tokens * 10**18);

        currentCampaign.heldBalance -= tokens;
        balance[currentCampaign.creator] -= tokens ;
        balance[msg.sender] += tokens;

        user.tokens +=tokens;
        user.receivedEth +=msg.value;
        user.contributer = msg.sender;
        user.campaignId = campaignId;

        emit contribution(campaignId, currentCampaign.contribution, msg.sender);
        return true;

    }

    /**
    * @notice handling the refund
    * @dev users can call refund if they want their contribution back before deadLine
    * @param campaignId campaignId helping to find the campaign by this id 
    * @return bool return true if the refund get success
    */

    function refund(uint256 campaignId, uint256 _amount) external payable isCampaignFound(campaignId) isDeadLinePassed(campaignId) returns (bool) {
        Campaign storage currentCampaign = campaigns[campaignId];
        ContributionReceipt storage user = receipts[campaignId][msg.sender];
        require(user.tokens >= _amount, "Incorrect amount");
        require(address(this).balance >= user.receivedEth, "contract low balance");

        ERC20Token(currentCampaign.contractAddress).transfer(msg.sender,currentCampaign.creator,_amount * 10**18);
        payable(msg.sender).transfer(_amount * currentCampaign.pricePerToken);
        user.tokens -= _amount;
        currentCampaign.contribution -= _amount;

        user.receivedEth -= (_amount) * currentCampaign.pricePerToken;
        currentCampaign.contribution = currentCampaign.contribution;
        currentCampaign.heldBalance += _amount;
        balance[currentCampaign.creator] = currentCampaign.heldBalance;
        balance[msg.sender] -= _amount;
        emit refunded(campaignId, _amount, msg.sender);

        return true;
    }

    /**
    * @notice handling the withDraw
    * @dev users can call withDraw if campaign deadLine crossed
    * @param campaignId campaignId helping to find the campaign by this id 
    * @return bool return true if the withDrawal gets success
    */

    function withDraw(uint256 campaignId) external isCampaignFound(campaignId) returns(bool) {
        Campaign storage currentCampaign = campaigns[campaignId];
        require(block.timestamp >= currentCampaign.endDate,"DeadLine not passed");
        require(currentCampaign.creator == msg.sender, "Not a creator");
        payable(msg.sender).transfer(currentCampaign.contribution * currentCampaign.pricePerToken);
        currentCampaign.withdrawalStatus = true;
        return true;
    }

    /**
     * @notice contribution receipt
     * @dev to get receipt for the contribution by the id and contributor address
     * @param campaignId helps to find the campaign agains
     * @param contributer address of the contributer
     * @return contributionReceipt returning struct of the contribution receipt
     */

    function getContributionReceipt(uint256 campaignId, address contributer) external view returns (ContributionReceipt memory) {
        return receipts[campaignId][contributer];
    }

    /**
     * @notice Get company
     * @dev get the company details
     * @param _contractAddress get the company details that are stored against to this contract address
     * @return company returning the structure of the company
     */

    function getCompany(address _contractAddress) public view returns (Company memory){
        return companies[_contractAddress];
    }

    /**
     * @notice get campaign
     * @dev get the campaign, that are stored against to the id
     * @param campaignId we can check and get the details of the campaign
     * @return campaign returning the all details of the campaign in structure
     */

    function getCampaign(uint256 campaignId) public view isCampaignFound(campaignId) returns(Campaign memory){
        return campaigns[campaignId];
    }

    /**
     * @notice get balance
     * @dev return the balance of the user
     * @param _address to get the balance, stored against to the address
     * @return balance returning the balance of the user in uint256 type
     */

    function getBalance(address _address) external view returns(uint256) {
        return balance[_address];
    }

    function ethBalance(address sender) external view returns(uint256) {
        return sender.balance;
    }

    function companyDetailsByCampaignId(uint256 campaignId) external view isCampaignFound(campaignId) 
    returns (
        address,
        string memory, 
        string memory, 
        uint256,
        bool
    ){
            Campaign memory _campaign = getCampaign(campaignId);
            Company memory _company = getCompany(_campaign.contractAddress);
            return (
                _company.contractAddress,
                _company.tokenName,
                _company.tokenSymbol,
                _company.totalSupply,
                _campaign.status == campainStatus.APPROVED ? true: false
            );           
    }
}

